import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div
      style={{
        borderWidth: 20,
        borderColor: "black",

        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
      }}
    >
      <div
        style={{
          width: "500px",
          height: "500px",
          backgroundColor: "gray",
        }}
      >
        <form>
          <label>
            Enter your name:
            <input type="text" />
          </label>
        </form>
        <button onclick="activateLasers()">Activer les lasers</button>
      </div>
    </div>
  );
}

export default App;
